/**
 * @param {string} s
 * @return {boolean}
 */
var validPalindrome = function(s) {
    if (judge(s)) return true;
    // O(n^2)
    for (let i = 0; i < s.length; i++) {
        let str = s.slice(0,i)+s.slice(i+1,s.length);
        if (judge(str)) return true;
    }
    return false;
};//Time Limit Exceeded

var validPalindrome = function(s) {
    let start = 0;
    let end = s.length-1;
    // O(n)
    // 找出不满回文的那一对
    while (start < end) {
        if (s[start] !== s[end]) { // 前后删除一个char
            return judge(s.slice(start,end)) || judge(s.slice(start+1,end+1));
        }
        start++;
        end--;
    }
    return true;
}; // 85.10%
 
// 判断回文
function judge(str) {
    for (let i = 0; i < parseInt(str.length/2); i++) {
        if (str[i] !== str[str.length-1-i]) {
            return false
        }
    }
    return true;
}

// 极限数据为50000，使用O(n^2)有点会超时

console.log(validPalindrome("bbadflj"));


